import React from "react";

const Alert = (props) => (
    <div className="alert-container">
        <ul>
            {props &&  props.validationMessages && props.validationMessages.map((message, index) => <li key={index}>{message}</li>)}
        </ul>
    </div>

);

export default Alert;
